const mainUser = {};

function checkEmptyMap(map) {
    let counter = 0;
    for (let i in map) {
        if (counter > 0) {
            return false;
        }
        counter++;
    }
    return true;
}

function renderUserBlock(mainUser) {
    if (checkEmptyMap(mainUser)) {
        return <Auth />
    }
    return <MainUser user={mainUser} />
}

function App() {
    useEffect(() => {
    }, [])

    return (
        <div className="container main text-white mt-3">
            <div className="col-12 mb-3">
                <img
                    width="100%"
                    src={mainLogoImg}
                    alt="Logo"
                />
            </div>
            {renderUserBlock(mainUser)}
        </div>
    );
}

export default App;
